import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Step 1: Add an item to the cart programmatically to set up the test state
    await page.evaluate(() => {
      // This function is defined in the provided script.js
      // We add product with id: 1 (Apple iPhone 15 Pro Max)
      addToCart(1);
    });

    // Step 2: Open the cart modal
    await page.locator('div.cart:has-text("Cart")').click();
    await page.waitForSelector('.cart-item', { state: 'visible' });

    // Take screenshot of the cart with the item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_with_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_with_item.png'));

    // Extract data before removal
    const itemTitle = await page.locator('.cart-item-title').textContent();
    const itemPrice = await page.locator('.cart-item-price').textContent();

    // Step 3: Click the remove button for the item
    await page.locator('button.remove-item').click();

    // Step 4: Verify the item is removed and the cart is empty
    await page.waitForSelector('.empty-cart:has-text("Your cart is empty")', { state: 'visible' });

    // Take screenshot of the empty cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_empty.png'));

    const emptyCartMessage = await page.locator('.empty-cart').textContent();

    return {
      success: true,
      action: "Successfully removed an item from the shopping cart.",
      extractedData: {
        itemRemoved: {
          title: itemTitle,
          price: itemPrice,
        },
        verificationMessage: emptyCartMessage
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    if (page) {
        const errorPath = path.join(screenshotsDir, 'error.png');
        await page.screenshot({ path: errorPath });
        screenshots.push(errorPath);
    }
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
